import { Box, Typography } from "@mui/material";
import React from "react";

const NoPosts = () => {
	return (
		<Box
			sx={{
				p: "40px",
				m: "10px",
				borderRadius: "40px",
			}}>
			<Box sx={{ display: "flex", mb: 2, flexDirection: "column" }}>
				<Typography variant='h3' sx={{ mb: 5 }}>
					Your next job is <b><span style={{ color: "rgb(72, 47, 215)"}}>Inbound</span></b>!
				</Typography>
				<Typography variant='h4'>
					Head to Settings and see opportunities from your favorite companies.
				</Typography>
				<Typography  sx={{ color: "gray"}} variant='h5'>
					Make sure to fill out your information in settings if you have not already.
				</Typography>
			</Box>
		</Box>
	);
};

export default NoPosts;
